const char * decNumberFromString(decNumber *dn, const char chars[],
                                 decContext *set) {
  Int   exponent=0;                
  uByte bits=0;                    
  Unit  *res;                      
  Unit  resbuff[SD2U(DECBUFFER+9)];

  Unit  *allocres=NULL;            
  Int   d=0;                       
  const char *dotchar=NULL;        
  const char *cfirst=chars;        
  const char *last=NULL;           
  const char *end=chars;
  const char *c;                   
  Unit  *up;                       
  #if DECDPUN>1
  Int   cut, out;                  
  #endif
  Int   residue;                   
  uInt  status=0;                  

  #if DECCHECK
  if (decCheckOperands(DECUNRESU, DECUNUSED, DECUNUSED, set))
    return decNumberZero(dn);
  #endif

  do {                             
    for (c=chars;; c++) {          
      if (*c>='0' && *c<='9') {    
        last=c;
        d++;                       
        continue;                  
        }
      if (*c=='.' && dotchar==NULL) { 
        dotchar=c;                 
        if (c==cfirst) cfirst++;   
        continue;}
      if (c==chars) {              
        if (*c=='-') {             
          cfirst++;
          bits=DECNEG;
          continue;}
        if (*c=='+') {             
          cfirst++;
          continue;}
        }

      break;
      } 

    if (last==NULL) {              
      status=DEC_Conversion_syntax;
      if (*c=='\0') break;         
      #if DECSUBSET

      if (!set->extended) break;   
      #endif

      if (dotchar!=NULL) break;    
      decNumberZero(dn);           
      if (decBiStr(c, "infinity", "INFINITY")
       || decBiStr(c, "inf", "INF")) {
        dn->bits=bits | DECINF;
        status=0;                  
        break; 
        }


      dn->bits=bits | DECNAN;      
      if (*c=='s' || *c=='S') {    
        c++;
        dn->bits=bits | DECSNAN;
        }
      if (*c!='n' && *c!='N') break;    
      c++;
      if (*c!='a' && *c!='A') break;    
      c++;
      if (*c!='n' && *c!='N') break;    
      c++;


      for (cfirst=c; *cfirst=='0';) cfirst++;
      if (*cfirst=='\0') {         
        status=0;                  
        break;                     
        }

      for (c=cfirst;; c++, d++) {
        if (*c<'0' || *c>'9') break; 
        last=c;
        }
      if (*c!='\0') break;         
      if (d>set->digits-1) {


        if (set->clamp) break;
        if (d>set->digits) break;
        } 

      status=0;                    
      bits=dn->bits;               
      } 

     else if (*c!='\0') {          

      status=0;                    
      end=c;                       
      Flag nege;                   
      const char *firstexp;        
      if (*c!='e' && *c!='E') goto finalize;


      nege=0;
      c++;                         
      if (*c=='-') {nege=1; c++;}
       else if (*c=='+') c++;
      if (*c<'0' || *c>'9') goto finalize;

      for (; *c=='0' && *(c+1)!='\0';) c++;  
      firstexp=c;                            
      for (; ;c++) {
        if (*c<'0' || *c>'9') break;         
        exponent=X10(exponent)+(Int)*c-(Int)'0';
        } 

      end=c;




      if (c>=firstexp+9+1) {
        if (c>firstexp+9+1 || *firstexp>'1') exponent=DECNUMMAXE*2;

        }
      if (nege) exponent=-exponent;     
      } 

      else end=c;
finalize:




    if (*cfirst=='0') {                 
      for (c=cfirst; c<last; c++, cfirst++) {
        if (*c=='.') continue;          
        if (*c!='0') break;             
        d--;                            
        } 
      #if DECSUBSET

      if (*cfirst=='0' && !set->extended) {
        decNumberZero(dn);              
        break;                          
        }
      #endif
      } 


    if (dotchar!=NULL && dotchar<last)  
      exponent-=(last-dotchar);         




    if (d<=set->digits) res=dn->lsu;    
     else {                             
      Int needbytes=D2U(d)*sizeof(Unit);
      res=resbuff;                      
      if (needbytes>(Int)sizeof(resbuff)) { 
        allocres=(Unit *)malloc(needbytes);
        if (allocres==NULL) {status|=DEC_Insufficient_storage; break;}
        res=allocres;
        }
      }




    #if DECDPUN>1
    out=0;                         
    up=res+D2U(d)-1;               
    cut=d-(up-res)*DECDPUN;        
    for (c=cfirst;; c++) {         
      if (*c=='.') continue;       
      out=X10(out)+(Int)*c-(Int)'0';
      if (c==last) break;          
      cut--;
      if (cut>0) continue;         
      *up=(Unit)out;               
      up--;                        
      cut=DECDPUN;                 
      out=0;                       
      } 
    *up=(Unit)out;                 

    #else

    up=res;                        
    for (c=last; c>=cfirst; c--) { 
      if (*c=='.') continue;       
      *up=(Unit)((Int)*c-(Int)'0');
      up++;
      } 
    #endif

    dn->bits=bits;
    dn->exponent=exponent;
    dn->digits=d;


    if (d>set->digits) {
      residue=0;
      decSetCoeff(dn, set, res, d, &residue, &status);

      decFinalize(dn, set, &residue, &status);
      }
     else { 

      if ((dn->exponent-1<set->emin-dn->digits)
       || (dn->exponent-1>set->emax-set->digits)) {
        residue=0;
        decFinalize(dn, set, &residue, &status);
        }
      }

    } while(0);                         

  if (allocres!=NULL) free(allocres);   
  if (status!=0) decStatus(dn, status, set);

