  struct test tests[NUMTESTS] = {
    { TJPF_RGB, 1, 0 },
    { TJPF_BGR, 2, 2 },
    { TJPF_RGBX, 3, 4 },
    { TJPF_BGRA, 4, 7 },
    { TJPF_XRGB, 5, 5 },
    { TJPF_GRAY, 6, 3 },
    { TJPF_CMYK, 7, 0 }
