	free(CONST_CAST(void*)cd->pbkdf.type);
	free(CONST_CAST(void*)cd->pbkdf.hash);
	free(CONST_CAST(void*)cd->user_key_name1);
	free(CONST_CAST(void*)cd->user_key_name2);


	crypt_safe_memzero(cd, sizeof(*cd));

}

